import React, { useEffect, useState } from 'react';

const AccountPage = () => {
  const [accountData, setAccountData] = useState(null);

  useEffect(() => {
    // Fetch account data from your API
    fetch('http://127.0.0.1:8000/api/showmyaccunt')
      .then((response) => response.json())
      .then((data) => setAccountData(data.data[0])); // Assuming you want to display data for the first account
  }, []);

  return (
    <div>
      <h1>My Account Page</h1>
      {accountData && (
        <table>
          <thead>
            <tr>
              <th>Attribute</th>
              <th>Value</th>
              <th>Euro Balance</th>
              <th>Turkish Lira Balance</th>
              <th>US Dollar Balance</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Account Number</td>
              <td>{accountData.accountNumber}</td>
              <td>{accountData.accmonies[0].balance}</td>
              <td>{accountData.accmonies[1].balance}</td>
              <td>{accountData.accmonies[2].balance}</td>
            </tr>
            <tr>
              <td>Opening Date</td>
              <td>{accountData.accountNumber}</td>
              <td>{accountData.openingDate}</td>
              {/* You can add more rows here for additional attributes */}
            </tr>
          </tbody>
        </table>
      )}
    </div>
  );
};

export default AccountPage;
